// 📁 src/components/LayerToggle.js

import React from "react";
import { Map, Alien } from "lucide-react";

const LayerToggle = ({ showMunicipalities, setShowMunicipalities, showAliens, setShowAliens }) => {
  return (
    <div className="layer-toggle">
      <button
        className={showMunicipalities ? "active" : ""}
        title="Toggle Municipalities"
        onClick={() => setShowMunicipalities(!showMunicipalities)}
      >
        <Map size={20} />
      </button>
      <button
        className={showAliens ? "active" : ""}
        title="Toggle Aliens"
        onClick={() => setShowAliens(!showAliens)}
      >
        <Alien size={20} />
      </button>
    </div>
  );
};

export default LayerToggle;
